import java.util.Random; public class TestParamBind { private static Random r = new Random(); private static Connection getConnection() throws SQLException { String jdbcUrl = String.format("jdbc:TAOS://%s:%s/%s?user=%s&password=%s", "localhost", "6030", "test", "root", "taosdata"); Connection conn = DriverManager.getConnection(jdbcUrl); return conn; } private static void createTable(Connection conn) throws SQLException { try(Statement stmt = conn.createStatement()) { stmt.executeUpdate("drop table weather_test"); stmt.executeUpdate("create stable " + "weather_test (ts timestamp, c1 int, c2 binary(10)) " + "tags(no int, location binary(10))"); } } public static void test() throws SQLException { Connection conn = null; try { conn = getConnection(); createTable(conn); // In the INSERT statement, // the VALUES clause allows you to specify a specific column; // If automatic table creation is adopted, // the TAGS clause needs to set the parameter values of all TAGS columns String psql = "insert into ? using weather_test tags (?, ?) (ts, c1, c2) values(?, ?, ?)"; try (TSDBPreparedStatement pst = (TSDBPreparedStatement) conn.prepareStatement(psql)) { pst.setTableName("w1"); // set tags pst.setTagInt(0, r.nextInt(10)); pst.setTagString(1, "Beijing"); int numOfRows = 10; // set values ArrayList<Long> ts = new ArrayList<>(); for (int i = 0; i < numOfRows; i++) { ts.add(System.currentTimeMillis() + i); } pst.setTimestamp(0, ts); ArrayList<Integer> s1 = new ArrayList<>(); for (int i = 0; i < numOfRows; i++) { s1.add(r.nextInt(100)); } pst.setInt(1, s1); ArrayList<String> s2 = new ArrayList<>(); for (int i = 0; i < numOfRows; i++) { s2.add("test" + r.nextInt(100)); } pst.setString(2, s2, 10); // The cache is not cleared after AddBatch. Do not bind new data again before ExecuteBatch pst.columnDataAddBatch(); pst.columnDataExecuteBatch(); // Clear the cache, after which you can bind new data(including table names, tags, values): pst.columnDataClearBatch(); pst.columnDataCloseBatch(); } } finally { if (conn != null) { conn.close(); } } } public static void main(String[] args) { try { test(); } catch (SQLException e) { e.printStackTrace(); } }
